-- --------------------------------------
-- Function Definition for last_updated()
-- --------------------------------------
CREATE OR REPLACE FUNCTION last_updated()
  RETURNS trigger AS
$BODY$
BEGIN
    NEW.last_update = CURRENT_TIMESTAMP;
    RETURN NEW;
END $BODY$
  LANGUAGE plpgsql VOLATILE
  COST 100;
ALTER FUNCTION last_updated()
  OWNER TO postgres;


